CREATE PROCEDURE public.query_exif_process_data(_point_within numeric, _pos_error_limit numeric)
    LANGUAGE plpgsql
    AS $$
/* PASS POINT AND POS_ERROR THRESHOLDS
 * 
 * Steps:
 * INSERT NON-EXISTING RECORDS INTO exif
 * ASSIGN SITE IDs TO POINTS WITHIN A SITE'S BORDERS
 * INSERT THE VARIOUS ERRORS INTO exif_error 
 * 		POINT is within 24” of another exif table point
 * 		POINT is within 24” of another bsd_site table point
 * 		Image has a duplicate timestamp in the exif table
 * 		Image has a duplicate GPS point in the exif table
 * 		Null pos_error
 * 		pos_error was equal to or greater than 0.2
 * 		Image has a duplicate timestamp but different GPS point in the bsd_site table
 * 		Image has a duplicate GPS point but different timestamp in the bsd_site table
 * 		SELECT non-error exifs for insertion into bsd_site
 * 
 * */

BEGIN
	
/* INSERT PROCEDURE AND QUERIES. PASS POINT AND POS_ERROR THRESHOLDS */

-- INSERT NON-EXISTING RECORDS INTO exif
	longitude, pos_err,	geo_point, pos_err_limit, proximity_limit)
SELECT t.localtimestamp, t.sitename_id, t.file_name, t.img_timestamp, t.latitude,
		t.longitude, t.pos_err, t.geo_point, t.pos_err_limit, t.proximity_limit
FROM (
	-- select distinct to remove duplicate rows
	SELECT DISTINCT localtimestamp, 0 AS sitename_id, file_name, img_timestamp, latitude,
		longitude, pos_err,	geo_point, pos_err_limit, proximity_limit
	FROM public.temp_exif_import
) t
WHERE NOT EXISTS (
	SELECT * FROM public.exif e
    WHERE 	e.file_name = t.file_name
    AND  	e.img_timestamp = t.img_timestamp
    AND  	e.geo_point = t.geo_point
   )
;

-- INSERT THE VARIOUS ERRORS INTO exif_error 
--POINT is within a specifed proximity of another exif table point
SELECT e.exif_id, e.error_id
FROM (
	SELECT DISTINCT l.id AS exif_id, 
		(SELECT id FROM public.lookup_error le
		WHERE error LIKE 'POINT is within a specifed proximity of another exif table point') AS error_id
	FROM public.exif r
	JOIN public.exif l
	ON ST_DWithin(r.geo_point, l.geo_point, _point_within)
	WHERE r.sitename_id = 0
	and l.id != r.id
	AND l.geo_point != r.geo_point
) e
WHERE NOT EXISTS (
	SELECT * FROM public.exif_error ee
	WHERE	ee.exif_id = e.exif_id
	AND		ee.error_id = e.error_id
)
;



--POINT is within a specifed proximity of another bsd_site table point
SELECT e.exif_id, e.error_id
FROM (
	SELECT DISTINCT r.id AS exif_id,
		(SELECT id FROM public.lookup_error le
		WHERE error LIKE 'POINT is within a specifed proximity of another bsd_site table point') AS error_id
	FROM public.exif r
	JOIN public.bsd_site_deleteme bs 
	ON ST_DWithin(r.geo_point, bs.geo_point, _point_within)
	WHERE r.sitename_id = 0
	and bs.id != r.id
	AND bs.geo_point != r.geo_point
) e
WHERE NOT EXISTS (
	SELECT * FROM public.exif_error ee
	WHERE	ee.exif_id = e.exif_id
	AND		ee.error_id = e.error_id
)
;

--Image has a duplicate timestamp in the exif table
SELECT e.exif_id, e.error_id
FROM (
	SELECT DISTINCT l.id AS exif_id,
		(SELECT id FROM public.lookup_error le
		WHERE error LIKE 'Image has a duplicate timestamp in the exif table') AS error_id
	FROM public.exif r
	JOIN public.exif l
	ON r.img_timestamp = l.img_timestamp
	WHERE r.sitename_id = 0
	and r.id != l.id
) e
WHERE NOT EXISTS (
	SELECT * FROM public.exif_error ee
	WHERE	ee.exif_id = e.exif_id
	AND		ee.error_id = e.error_id
)
;

--Image has a duplicate GPS point in the exif table
SELECT e.exif_id, e.error_id
FROM (
	SELECT DISTINCT l.id AS exif_id,
		(SELECT id FROM public.lookup_error le
		WHERE error LIKE 'Image has a duplicate GPS point in the exif table') AS error_id
	FROM public.exif r
	JOIN public.exif l
	ON r.geo_point = l.geo_point
	WHERE r.sitename_id = 0
	and r.id != l.id
) e
WHERE NOT EXISTS (
	SELECT * FROM public.exif_error ee
	WHERE	ee.exif_id = e.exif_id
	AND		ee.error_id = e.error_id
)
;

--Null pos_error
SELECT e.exif_id, e.error_id
FROM (
	SELECT DISTINCT l.id AS exif_id,
		(SELECT id FROM public.lookup_error le
		WHERE error LIKE 'Null pos_error') AS error_id
	FROM public.exif l
	WHERE l.sitename_id = 0
	and l.pos_err IS NULL 
) e
WHERE NOT EXISTS (
	SELECT * FROM public.exif_error ee
	WHERE	ee.exif_id = e.exif_id
	AND		ee.error_id = e.error_id
)
;

--pos_error was equal to or greater than a specifed limit
SELECT e.exif_id, e.error_id
FROM (
	SELECT DISTINCT l.id AS exif_id,
		(SELECT id FROM public.lookup_error le
		WHERE error LIKE 'pos_error was equal to or greater than a specifed limit') AS error_id
	FROM public.exif l
	WHERE l.sitename_id = 0
	and l.pos_err >= _pos_error_limit
) e
WHERE NOT EXISTS (
	SELECT * FROM public.exif_error ee
	WHERE	ee.exif_id = e.exif_id
	AND		ee.error_id = e.error_id
)
;

--Image has a duplicate timestamp but different GPS point in the bsd_site table
SELECT e.exif_id, e.error_id
FROM (
	SELECT DISTINCT r.id AS exif_id,
		(SELECT id FROM public.lookup_error le
		WHERE error LIKE 'Image has a duplicate timestamp but different GPS point in the bsd_site table') AS error_id
	FROM public.exif r
	JOIN public.bsd_site_deleteme bs
	ON (bs.info ->> 'img_timestamp')::timestamp = r.img_timestamp
	WHERE r.sitename_id = 0
	and bs.geo_point != r.geo_point
) e
WHERE NOT EXISTS (
	SELECT * FROM public.exif_error ee
	WHERE	ee.exif_id = e.exif_id
	AND		ee.error_id = e.error_id
)
;

--Image has a duplicate GPS point but different timestamp in the bsd_site table
SELECT e.exif_id, e.error_id
FROM (
	SELECT DISTINCT r.id AS exif_id,
		(SELECT id FROM public.lookup_error le
		WHERE error LIKE 'Image has a duplicate GPS point but different timestamp in the bsd_site table') AS error_id
	FROM public.exif r
	JOIN public.bsd_site_deleteme bs
	ON bs.geo_point = r.geo_point
	WHERE r.sitename_id = 0
	and (bs.info ->> 'img_timestamp')::timestamp != r.img_timestamp
) e
WHERE NOT EXISTS (
	SELECT * FROM public.exif_error ee
	WHERE	ee.exif_id = e.exif_id
	AND		ee.error_id = e.error_id
)
;

-- ASSIGN SITE IDs TO POINTS WITHIN A SITE'S BORDERS
-- WHERE exif sitename_id = 0
UPDATE public.exif
SET sitename_id = border_id
FROM (
	SELECT e.id AS exif_id, lbp.id AS border_id
	FROM public.exif e
	JOIN public.lookup_borders_plot lbp
	ON ST_DWithin(e.geo_point, lbp.border, 0)
	WHERE e.sitename_id = 0
	) sq
WHERE id = sq.exif_id
;

-- SELECT non-error exifs for insertion into bsd_site
	created_by, last_updated_on, last_updated_by)
SELECT ex.*
FROM (
	SELECT w.info, w.sitename_id, w.geo_point, w.created_on, w.created_by, 
		w.last_updated_on, w.last_updated_by
	FROM (
		WITH u AS (SELECT user_id FROM lookup_users WHERE "name" LIKE 'Field Data')
		SELECT id,
		('{"File Name" : "' || e.file_name || '", "Image Timestamp" : "' || e.img_timestamp || 
		'", "Latitude" : ' || e.latitude || ', "Longitude" : ' || e.longitude || 
		', "Horizontal Position Error" : ' || e.pos_err || '}')::jsonb AS info, 
		e.sitename_id, e.geo_point, 
		localtimestamp AS created_on, u.user_id AS created_by,
		localtimestamp AS last_updated_on, u.user_id AS last_updated_by
		FROM public.exif e, u
	) w
	LEFT OUTER JOIN (SELECT DISTINCT exif_id FROM public.exif_error) ee 
	ON w.id = ee.exif_id
	WHERE ee.exif_id IS NULL
	AND sitename_id > 0
) ex
WHERE NOT EXISTS (
	SELECT * FROM public.bsd_site_deleteme bs
	WHERE	bs.geo_point = ex.geo_point
)
;

-- Insert only one duplicate-timestamp item into bsd_site
/*Get a single ID from the duplicates.
 Include all "Image has a duplicate timestamp in the exif table" errors and
 ignore records outside of the specified pos error and proximity limits,
 specifically one of these errors: 
		POINT is within a specifed proximity of another exif table point
		POINT is within a specifed proximity of another bsd_site table point
		pos_error was equal to or greater than a specifed limit
 */	
	created_by, last_updated_on, last_updated_by)
SELECT ex.*
FROM (
	with dups as (
	SELECT MAX(id) as id
		from(
			SELECT DISTINCT l.*
			FROM public.exif r
			JOIN public.exif l
			ON r.img_timestamp = l.img_timestamp
			and r.id != l.id
			order by l.img_timestamp
		) d 
		group by img_timestamp
	)
	SELECT w.info, w.sitename_id, w.geo_point, w.created_on, w.created_by, 
			w.last_updated_on, w.last_updated_by
	FROM (
		WITH usr AS (SELECT user_id FROM lookup_users WHERE "name" LIKE 'Field Data')
		SELECT id,
		('{"File Name" : "' || e.file_name || '", "Image Timestamp" : "' || e.img_timestamp || 
		'", "Latitude" : ' || e.latitude || ', "Longitude" : ' || e.longitude || 
		', "Horizontal Position Error" : ' || e.pos_err || '}')::jsonb AS info, 
		e.sitename_id, e.geo_point, 
		localtimestamp AS created_on, usr.user_id AS created_by,
		localtimestamp AS last_updated_on, usr.user_id AS last_updated_by
		FROM public.exif e
		join
			(
			select ee.exif_id from exif_error ee
			where ee.exif_id in (
				select id from dups
			)
			and (ee.error_id not in (
					select le.id from public.lookup_error le
					where le.error like 'POINT is within a specifed proximity of another exif table point'
					or le.error like 'POINT is within a specifed proximity of another bsd_site table point'
					or le.error like 'pos_error was equal to or greater than a specifed limit'
					) 
				and ee.error_id = (select id from public.lookup_error where error like'Image has a duplicate timestamp in the exif table')
				)
			) f
		on id = f.exif_id, 
		usr
	) w
) ex
WHERE NOT EXISTS (
	SELECT * FROM public.bsd_site_deleteme bs
	WHERE	bs.geo_point = ex.geo_point
)
;

