--
-- TOC entry 1729 (class 1255 OID 27986)
-- Name: query_search_by_area(text, text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.query_search_by_area(_column_name text, _column_value text, _organism_name text) RETURNS TABLE("siteId" integer, "organismName" text, "geoPoint" text)
    LANGUAGE plpgsql
    AS $_$
declare

BEGIN
	return query
	
	EXECUTE format ($ex$select bsd_id, organism_name, geo_point
	from (
		select bs.id as bsd_id, bt.organism_name, ST_AsText(bs.geo_point) as geo_point,
		lb.name as area_name, lbp.name as plot_name
		from bsd_site bs
		join bsd_tree bt on bt.site_id = bs.id
		join lookup_borders_plot lbp on lbp.id = bs.lookup_sitename_id
		join lookup_borders lb on lbp.border_id = lb.id
		where organism_name is not null
		and upper(organism_name) like '%%' || upper(replace(%3$L, '_', '\_')) || '%%'
	) geopoints
	where %1$s = %2$L
	order by organism_name
	;$ex$, _column_name, _column_value, _organism_name);
	
end;
$_$;


