COMMENT ON TABLE public.exif IS 'The file_name, POINT, and img_timestamp will determine duplicate records.
''Valid'' site data will be inserted into bsd_site where:
	exif''s id IS NOT in exif_error,
	where no exif table POINTs are within a specifed proximity of the POINTs in bsd_site,
	and WHERE NOT EXISTS for the POINT in bsd_site. 
The table will be ''scanned'' using the following criteria to add an error record in exif_error: 
		A POINT is within a specifed proximity of another in the exif table (POINT is within a specifed proximity of another exif table point), 
		A duplicate img_timestamp within the exif table (Image has a duplicate timestamp in the exif table),  
		A duplicate POINT within the exif table (Image has a duplicate GPS point in the exif table), 
		Any records outside of the pos_error threshold (pos_error was equal to or greater than a specifed limit) or have a null value (Null pos_error).
		If a POINT is within a specifed proximity of a bsd_site POINT, an error will be added,
		Image has a duplicate timestamp but different GPS point in the bsd_site table,
		Image has a duplicate GPS point but different timestamp in the bsd_site table';


